import React from 'react';
import logo from './logo.svg';
import './App.css';
import AppColor from './color_comps/appColor';
import AppExchage from './exchange_comps/appExchage';
import AppVip from './vip_comps/appVip';
import AppShop from './shop_comps/appShop';
import AppCartoon from './cartoon_comps/appCartoon';



function App() {
  return (
    <div className="App">
      <AppCartoon/>
      <hr/>
      <AppShop/>
      <hr/>
      <AppVip/>
      <hr/>
      <AppExchage/>

    <hr/>
     <AppColor h2Text ={"Title from app 333"}/>
    </div>
  );
}

export default App;
